in Lmby varchar(45), in StID INT,in AtID INT)
begin
	delete from assignments where CaseID = cid ;
	
	insert INTO assignments (CaseID,AppUserID,CreatedBy,LastModifiedBy,StatusID)  VALUES 
   (Cid,Auid,Crby,Lmby,StID) ;
